selector_to_html = {"a[href=\"#die-k-nachsten-nachbarn-bestimmen\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.5.1. </span>Die <span class=\"math notranslate nohighlight\">\\(k\\)</span> n\u00e4chsten Nachbarn bestimmen<a class=\"headerlink\" href=\"#die-k-nachsten-nachbarn-bestimmen\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#der-algorithmus-als-ganzes\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.5.3. </span>Der Algorithmus als Ganzes<a class=\"headerlink\" href=\"#der-algorithmus-als-ganzes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#daten-in-objekte-der-klasse-tier-einlesen\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.3.2. </span>Daten in Objekte der Klasse <em>Tier</em> einlesen<a class=\"headerlink\" href=\"#daten-in-objekte-der-klasse-tier-einlesen\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#ahnlichkeit-als-distanz\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.4. </span>\u00c4hnlichkeit als Distanz<a class=\"headerlink\" href=\"#ahnlichkeit-als-distanz\" title=\"Link to this heading\">#</a></h2><p>Um herauszufinden, zu welcher Spezies das neue Tier geh\u00f6rt, m\u00fcssen wir \u201c\u00e4hnliche\u201d Tiere\nfinden.  Die entscheidende Idee hierbei ist, dass wir \u00c4hnlichkeit als <em>Distanz zwischen den\nDatenpunkten</em> definieren: Jedes Tier ist charakterisiert durch zwei Merkmale (Niedlichkeit und\nFlauschigkeit). Diese beiden Werte definieren einen <em>Punkt</em> im zweidimensionalen Raum. Je\nkleiner der Abstand zwischen zwei Punkten, desto \u00e4hnlicher sind die beiden Tiere. Wenn wir\nnoch mehr Merkmale h\u00e4tten, k\u00f6nnten wir den Raum entsprechend erweitern, also z.B. bei drei\nMerkmalen den Abstand zwischen zwei Punkten im dreidimensionalen Raum berechnen.</p>", "a[href=\"#einen-noch-ungelabelten-datensatz-vorbereiten-und-anzeigen\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.3.4. </span>Einen (noch) ungelabelten Datensatz vorbereiten und anzeigen<a class=\"headerlink\" href=\"#einen-noch-ungelabelten-datensatz-vorbereiten-und-anzeigen\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#eine-abstimmung-unter-den-nachsten-nachbarn-durchfuhren\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.5.2. </span>Eine \u201cAbstimmung\u201d unter den n\u00e4chsten Nachbarn durchf\u00fchren<a class=\"headerlink\" href=\"#eine-abstimmung-unter-den-nachsten-nachbarn-durchfuhren\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#programmierung-des-algorithmus-2\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.5. </span>Programmierung des Algorithmus (2)<a class=\"headerlink\" href=\"#programmierung-des-algorithmus-2\" title=\"Link to this heading\">#</a></h2><h3><span class=\"section-number\">21.5.1. </span>Die <span class=\"math notranslate nohighlight\">\\(k\\)</span> n\u00e4chsten Nachbarn bestimmen<a class=\"headerlink\" href=\"#die-k-nachsten-nachbarn-bestimmen\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#einige-beispiele\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.5.4. </span>Einige Beispiele<a class=\"headerlink\" href=\"#einige-beispiele\" title=\"Link to this heading\">#</a></h3><p>Das n\u00e4chste Beispiel f\u00fchrt zu einem etwas unbefriedigenden Ergebnis\u2026 Findest du nicht auch?</p>", "a[href=\"#intuitive-beschreibung-des-algorithmus\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.2. </span>Intuitive Beschreibung des Algorithmus<a class=\"headerlink\" href=\"#intuitive-beschreibung-des-algorithmus\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#programmierung-des-algorihmus-1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.3. </span>Programmierung des Algorihmus (1)<a class=\"headerlink\" href=\"#programmierung-des-algorihmus-1\" title=\"Link to this heading\">#</a></h2><h3><span class=\"section-number\">21.3.1. </span>Beispieldaten vorbereiten<a class=\"headerlink\" href=\"#beispieldaten-vorbereiten\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#einfuhrung-tiere-klassifizieren\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.1. </span>Einf\u00fchrung: Tiere klassifizieren<a class=\"headerlink\" href=\"#einfuhrung-tiere-klassifizieren\" title=\"Link to this heading\">#</a></h2><p><strong>Interaktives Ausprobieren des k-NN-Verfahrens:</strong> Bewege deinen Mauszeiger \u00fcber die Darstellung unten. Jede Position entspricht einem Tier mit einer gewissen Niedlichkeit und Flauschigkeit. Klicke an eine Position um zu sehen, in welche Kategorie der kNN-Algorithmus dieses Tier einordnen w\u00fcrde. Klicke erneut, um eine neue Position zu suchen.</p>", "a[href=\"#euklidische-distanz\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.4.1. </span>Euklidische Distanz<a class=\"headerlink\" href=\"#euklidische-distanz\" title=\"Link to this heading\">#</a></h3><p>Es gibt verschiedene Definitionen f\u00fcr den Abstand zwischen zwei Punkten. Du kennst schon lange\nden sogenannten <strong>euklidischen Abstand</strong>, der zwischen zwei\nPunkten <span class=\"math notranslate nohighlight\">\\(P(x_P, y_P)\\)</span> und <span class=\"math notranslate nohighlight\">\\(Q(x_Q, y_Q)\\)</span> in der Ebene wie folgt definiert ist:</p>", "a[href=\"#daten-visualisieren\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.3.3. </span>Daten visualisieren<a class=\"headerlink\" href=\"#daten-visualisieren\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#der-k-nachste-nachbarn-algorithmus\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21. </span>Der k-N\u00e4chste-Nachbarn-Algorithmus<a class=\"headerlink\" href=\"#der-k-nachste-nachbarn-algorithmus\" title=\"Link to this heading\">#</a></h1><p>Der <a class=\"reference external\" href=\"https://de.wikipedia.org/wiki/N%C3%A4chste-Nachbarn-Klassifikation\">k-N\u00e4chste-Nachbarn-Algorithmus</a> klassifiziert\neinen bisher ungelabelten Datensatz, indem er ihn mit seinen \u201cn\u00e4chsten Nachbarn\u201d vergleicht, d.h. mit\ndenjenigen bereits gelabelten Datens\u00e4tzen, die dem neuen Datensatz <em>am \u00e4hnlichsten</em> sind.<br/>\nDem unbekannten Datensatz wird dann dasjenige Label zugeordnet, das die <em>Mehrheit</em> der \u201cNachbarn\u201d hat.</p><p>Klingt kompliziert? Keine Sorge - das Verfahren ist total einfach.  Am folgenden <em>interaktiven</em> Beispiel wirst du schnell verstehen, wie der k-N\u00e4chste-Nachbarn-Algorithmus funktioniert.</p>", "a[href=\"#beispieldaten-vorbereiten\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.3.1. </span>Beispieldaten vorbereiten<a class=\"headerlink\" href=\"#beispieldaten-vorbereiten\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#manhattan-distanz\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.4.2. </span>Manhattan-Distanz<a class=\"headerlink\" href=\"#manhattan-distanz\" title=\"Link to this heading\">#</a></h3><p>Es gibt aber auch andere M\u00f6glichkeiten, den Abstand zwischen zwei Punkten zu definieren. Eine\nbekannte Alternative ist die sogenannte <strong>Manhattan-Distanz</strong>, bei der man einfach die Abst\u00e4nde\nin den einzelnen Dimensionen aufaddiert:</p>"}
